window.bookSummaryJSON = "<p>The Summer Court princess has never failed to end the curse that ravages Faerie every hundred years, until now. As the Fall princess, the responsibility has fallen on me to stop the poison destroying my realm. I must go to Ethereum to fetch the heart of one of its dark lords, or my people will perish.</p> <p>Everything unravels the moment I step foot in Ethereum. Thrown into my target's dungeon and in fear for my life, I can see no way to save myself, let alone my kingdom. The scarred Ethereum lord who holds me is brutal, unforgiving, and only keeping me alive as long as I'm useful to him.</p> <p>Yet I have a secret, harbored my entire life, and if I can use it to my advantage, there is a chance I and my people might come through unscathed?</p>"; 
